PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "prayer_times" ("id" integer primary key AUTOINCREMENT NOT NULL, "location_id" integer NOT NULL, "year" integer NOT NULL, "month" integer NOT NULL, "day" integer NOT NULL, "imsa" integer NOT NULL, "fajr" integer NOT NULL, "shuruq" integer NOT NULL, "duha" integer NULL, "dhuhr" integer NOT NULL, "asr" integer NOT NULL, "maghrib" integer NOT NULL, "isha" integer NOT NULL);
